import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const step1 = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: step1 });
    screenshots.push(step1);

    // Wait for the search input using a different selector strategy (attribute selector)
    await page.waitForSelector('input[placeholder="Search Amazon"]', { timeout: 5000 });

    // Attempt XSS via search input
    const xssPayload = `<img src=x onerror=alert('XSS')>`;
    await page.fill('input[placeholder="Search Amazon"]', xssPayload);

    // Take screenshot after filling input
    const step2 = path.join(screenshotsDir, 'step_2_xss_input.png');
    await page.screenshot({ path: step2 });
    screenshots.push(step2);

    // Click the search button using a different selector (by visible role and nth-of-type)
    // There are multiple .search-btn, so use nth-of-type to select the first visible one
    const searchBtnSelector = '.search-btn';
    await page.waitForSelector(searchBtnSelector, { timeout: 5000 });
    // Ensure we click the first visible search button
    const searchBtns = await page.$$(searchBtnSelector);
    let clicked = false;
    for (const btn of searchBtns) {
      if (await btn.isVisible()) {
        await btn.click();
        clicked = true;
        break;
      }
    }

    // Take screenshot after clicking search
    const step3 = path.join(screenshotsDir, 'step_3_after_search.png');
    await page.screenshot({ path: step3 });
    screenshots.push(step3);

    // Wait for any possible XSS effect (e.g., DOM change, new element, etc.)
    // Try to extract if the payload is reflected somewhere in the DOM
    // We'll look for our payload string in the page content
    const pageContent = await page.content();
    const xssReflected = pageContent.includes(xssPayload);

    // Try to extract any element containing our payload (e.g., innerHTML)
    const possibleXss = await page.$$eval('*', (nodes, payload) => {
      return nodes
        .filter(n => n.innerHTML && n.innerHTML.includes(payload))
        .map(n => ({ tag: n.tagName, html: n.innerHTML }));
    }, xssPayload);

    return {
      success: true,
      action: "Attempted XSS via search input and checked for payload reflection",
      extractedData: {
        xssPayload,
        xssReflected,
        possibleXssElements: possibleXss
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
